const RegexExp = (value) => {

    var RegexExp = /^(\[\[\d+,\s?\d+\](,\s?\[\d+,\s?\d+\])*\]|\[\d+,\s?\d+\](,\s?\[\d+,\s?\d+\])*)$/;
    return (!RegexExp.test(value) ? "2D array Syntax error" : "")
}

function Inputvalidator(value) {
    return (RegexExp(value))
}

export default Inputvalidator;
